import "../css/Social.css";
import Post from "./Post";
import logo from "../images/pawprint_logo.png";
import cat_img from "./images/social/powell_cat_image.jpg";
function Social() {
  return (
    <div className="App">
      <div className="pawprint_header">
        <img className="pawprint_logo" src={logo} alt="Pawprint logo" />
        <strong>Pawprint</strong>
        <button className="pawprint_trending">
          <strong>Trending</strong>
        </button>
        <button className="user_login">
          <strong>Log In</strong>{" "}
        </button>
      </div>
      <Post
        username="adithi.ramesh02"
        caption="So Cute!!"
        image={cat_img}
        tag="cat"
      />
    </div>
  );
}

export default Social;
